import logo from './logo.svg';
import './App.css';

function App() {

  const handleChange = (event) => {
    console.log(event.target.value)
  }

  return (
    <div className='App'>
      <header className="App-header">
        <h1>Tic-Tac-Toe Game</h1>
      </header>
      <div>Sina</div>
      <table>
        <tr>
          <td><input type="checkbox" onChange={() => handleChange(1)}></input></td>
          <td><input type="checkbox"></input></td>
          <td><input type="checkbox"></input></td>
        </tr>

        <tr>
          <td><input type="checkbox"></input></td>
          <td><input type="checkbox"></input></td>
          <td><input type="checkbox"></input></td>
        </tr>

        <tr>
          <td><input type="checkbox"></input></td>
          <td><input type="checkbox"></input></td>
          <td><input type="checkbox"></input></td>
        </tr>
      </table>
    </div>
  );
}

export default App;
